import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
    return (
        <>
            <NavLink exact activeClassName="styleClass" to="/home">Home</NavLink>
            <NavLink exact activeClasSName="styleClass" to="/name">Name</NavLink>
            <NavLink exact activeClasSName="styleClass" to="/service">Service</NavLink>
            <NavLink exact activeClasSName="styleClass" to="/contact">Contact</NavLink>
        </>
    );
}

export default Menu;
